  [],\n\t\"revision_timestamp\": \"2016-07-27T23:01:31.182277\",\n\t\"name\": \"hanford-reach-ringold-russian-knapweed-treatment\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Increase the diversity of the seed mix
  on approximately 250 acres in the Ringold Unit of the Hanford Reach National Monument
  (Monument) treated with aminopyralid as part of an Integrated PestManagement (IPM)
  plan to replace the Russian knapweed (Acroptilon repens/Rhaponticum repens), a Class
  B noxious weed in Washington State, which has existed as a virtual monoculture in
  these locations.This proposal will allow the Monument to plant additional native
  grass species for long term control of a virtual monoculture of Russian knapweed
  (knapweed) in the northern portion of the Ringold Unit whichwas treated with herbicide
  in the fall of 2014. The funding will allow the addition of three (3) early seral
  native grass species (Sand dropseed (Sporobolus cryptandrus), Sandbergu2019s bluegrass
  (Poa secunda), and Inland saltgrass (Distichlis spicata)) to complement the slower
  growing replacement grasses the Monument has already purchased. This component of
  the treatment will take advantage of the competition provided by these three species
  to control the bulbous bluegrass (Poa bulbosa L.) andcheatgrass (Bromus tectorum)
  in the area but not present in the knapweed monoculture.\",\n\t\"license_title\":
